    'punkt33_4_5': 'Образи, обірвані думки, яскраві картинки. Тендітність і дивність, червоне і чорне. Натяк на значення, непевний - радше відмова від ясної артикуляції, алогічний синтез. Переклад навпомацки поезії Катерини Калитко у рух розкрив для нас детальність її мови – а занурення у неї допомогло створити просту й чітку розмову. У ній мало слів, і багато здогадок «Просто одна людина вибрала собі іншу за полотно»',
