    'punkt33_5_5': 'На Тральфамадорі тексти створюють такою комбінацією символів, „ щоб читач, зиркнувши на неї і охопивши її своїм поглядом, побачив образ життя, прекрасного і несподіваного, і наповненого глибоким змістом. У такому творі немає ні початку, ні середини, ні кінця, ні інтриги, ні моралі, ні причини, ні наслідку”. (Курт Воннегут «Бійня номер п’ять»)',
