    'punkt33_5_4': 'Sound: Vyacheslav Los.',
    'punkt33_5_5': 'On Tralfamador, texts are created with such a combination of symbols "so that the reader, looking at it and covering it with his gaze, sees an image of life, beautiful and unexpected, and filled with deep meaning." In such a work there is no beginning, no middle, no end, no intrigue, no morality, no cause and effect." (Kurt Vonnegut "Slaughterhouse Number Five")',
