    'punkt33_6_2': '"60 MOVES with FUTURE GAZE" bada związek między architekturą a ludzkim ciałem, aby lepiej zrozumieć, jak architektura wpływa na naszą tożsamość i wzorce zachowań. Co czujemy dziś, będąc otoczeni ideologią przeszłości - przeszłości głęboko ucieleśnionej w architekturze? I kim jesteśmy MY - ludzie, którzy żyli w czasach dramatycznych zmian, którzy wciąż są w trakcie procesu samoidentyfikacji - rozrzucania ruin przeszłości na rzecz przyszłości.',
