    'punkt33_6_1': 'Мейда Візерс, відома хореографиня з Вашингтону, округ Колумбія, та Антон Овчінніков, засновник фестивалю ZelyonkaFest, Київ, спільно створили "60 MOVES with FUTURE GAZE" --  перформанс за участю 17 українських сучасних танцівників та живої електронної музики, написаної та виконаної Стівом Хілмі, США, на честь 60-ї ЮВІЛЕЙНОЇ ГАЛА-ВЕЧІРКИ ІСТОРИЧНОГО НАЦІОНАЛЬНОГО ВИСТАВКОВОГО ЦЕНТРУ (Експоцентру) в Києві, Україна.',
    'punkt33_6_2': '"60 MOVES with FUTURE GAZE " досліджує взаємозв’язок між архітектурою та людським тілом для того, щоб краще зрозуміти як архітектура впливає на нашу ідентичність та моделі поведінки. Що ми відчуваємо сьогодні, перебуваючи в оточенні ідеології минулого - минулого, глибоко втіленого в архітектурі? І хто є МИ - люди, які жили в часи драматичних змін, які все ще перебувають у процесі самоідентифікації - розкидаючи руїни минулого заради майбутнього.',
