    'zag33_22': '(Kyiv, Ukraine 2018)',
    'zag33_33': 'The cooperation project of Maida Withers (USA) and Black O!Range DP (Ukraine)',
    'punkt33_6_1': 'Maida Withers, noted Washington, DC choreographer, and Anton Ovchinnikov, ZelyonkaFest founder, Kiev, co-created “60 MOVES with FUTURE GAZE,” a site-specific performance featuring 17 Ukrainian contemporary dancers and live electronic music composed and performed by Steve Hilmy, USA,  in honor of the 60th ANNIVERSARY GALA CELEBRATION of The Historic National Exhibition (Expo) Center, Kiev, Ukraine.',
    'punkt33_6_2': '“60 MOVES with FUTURE GAZE” explores the relationship between architecture and the human body in order to better understand how architecture affects our identity and patterns of behavior. What do we feel today, being surrounded by the ideology of the past – a past deeply embodied in architecture? And who are WE – the people who have lived in times of dramatic change, who are still in the process of self-identification – scattering the ruins of the past for the sake of the future.',
