    'punkt33_1_6': '„MIKROCIAŁO” - performance ciał. O kobiecym ciele, o dojrzałej kobiecości, o odchodzeniu, przychodzeniu, o zmianie. Trochę na sentymentalnie i smutno, trochę nie... Działamy cieleśnie, z uważnością na detale. Tworzymy z ciał ruchome rzeźby i obrazy. Czasem pojawiają się dźwięki i słowa, niewiele. Używamy ruchu z codzienności, przetworzonego przez doświadczenie tańczących ciał. Bierzemy z historii, odczuć i myśli.',
    'punkt33_1_7': 'Spektakl traktuje ciało jako przestrzeń. Ciało ją otacza, jest tuż obok. Jest przeźroczyste, powietrzne, jest przezroczystą odległością. Pojemne, rozległe, przenika, oddycha. Przestrzeń i powietrze łączą, ”mylą się ze sobą”. Ciało jest przestrzenią, substancją doświadczeń, miejscem zapełnionym duchem. To przestrzeń, która sprzyja.',
    'punkt33_1_8': 'Performerki dzielą się spojrzeniem na potencjał ciała zmieniającego się z wiekiem. W działaniach performatywnych wzmacniają i gruntują poczucie sprawczości, osadzenia i kontroli.',
