    'punkt33_1_13': 'Gosia Zagajewska - wokalistka i poetka. Współtworzyła Warsaw Improvisers Orchestra. Wydała albumy z zespołami Tuleje, Voice Act, Goutte, Szpety, Casting Lots. Koncertowała w Polsce, Czechach, Słowacji, Niemczech i Wielkiej Brytanii.',
