    'prepod': 'Teaching activities',
    'contacts': 'Additional information, contacts',
    'zag33_1': 'MICROBODY',
    'zag33_2': '(Poznan, Poland 2024)',
    'punkt33_1_1': 'Concept and choreography: Aniela Kokosha',
    'punkt33_1_2': 'in collaboration with Olga Kebas and Agnieszka Noster',
    'punkt33_1_3': 'Performance: Olga Kebas, Agnieszka Noster, Aniela Kokosha',
    'punkt33_1_4': 'Voice: Gosia Zagajewska',
    'punkt33_1_5': 'Costumes: Idalia Mantas',
    'punkt33_1_6': '“MICROBODY” is a performance of bodies. It is about the female body, about mature femininity, about leaving, coming, about changes. A little bit about sentimental and sad, a little bit not.... We act bodily, with attention to detail. We create moving sculptures and images from our bodies. Sometimes there are sounds and words, not much. We use movements from everyday life, transformed through the experience of dancing bodies. We draw from stories, feelings and thoughts.',
    'punkt33_1_7': 'In the performance, the body is seen as a space. The body surrounds it, is next to it. It is as transparent as air, a transparent distance. Capacious, immense, it permeates, breathes. Space and air merge, “get confused with each other”. The body is space, the substance of experience, a place filled with spirit. It is a space that nourishes.',
    'punkt33_1_8': 'The performers share their vision of the body’s potential, which changes with age. In their performative actions, they reinforce and deepen the sense of activity, capability, rooting and control.',
    'punkt33_1_9': 'Intibag sensory cocoons accompany us during the performance.',
    'punkt33_1_10': 'Aniela Kokosza is a performer, choreographer, teacher and choreotherapist. She works as an independent artist at the intersection of dance, performance and body science.',
    'punkt33_1_11': 'Olga Kebas is a performer, dancer, choreographer, researcher and teacher of contemporary dance, curator and organizer of cultural events.',
    'punkt33_1_12': 'Agnieszka Noster is a dancer, choreographer, Master of Arts, graduate of the University of Arts in Poznan, studied choreography at the Academy of Music in Lodz.',
    'punkt33_1_13': 'Gosia Zagajewska is a vocalist and poet. She is a co-founder of the Warsaw Improvisers Orchestra. She has released albums with the bands Tuleje, Voice Act, Goutte, Szpety, Casting Lots. She has performed in Poland, the Czech Republic, Slovakia, Germany, and the UK.',    
